var countup = (t) => (a,b) => {
  a[b[t]] = (a[b[t]]||0) + 1;
  return a;
}

var count = (array,t) => {
  return Object.entries(array.reduce((a,b) => {
    a[b[t]] = (a[b[t]]||0) + 1;
    return a;
  },{})).sort((a,b)=>b[1]-a[1])
}

