var hostIcon = (icon) => {
  var host = icon.match(/\/([^\/\.]+?)_?(?:virtual|physical)?_?host\./)?.[1];
  if(!host) return null;
  return `https://munzee.global.ssl.fastly.net/images/pins/${creatures[host]??host}.png`;
}

